import "./App.css";
import Form from "./component/Form";
import Navbar from "./component/Navbar";
import { useState } from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {

  return (
    <div style={{
      width: "100vw",
      height: "100vh",
      background: "linear-gradient(135deg, #153677, #4e085f)",
    }}>
      <Navbar/>

      <div
        className="container"
      >

        {/* <Form buttonTask = "Sign In"/> */}

        <Router>
          <Routes>
            <Route path="#signIn" element={<Form buttonTask = "Sign In"/>} ></Route>
          </Routes>
        </Router>
      </div>
    </div>
  );
}

export default App;
